import React from 'react'

const App = () => {
    const bgChange = () => {
        console.log("clicked");
    }
    return (
        <>
        <div style = { { backgroundColor : 'red' } } >
            <button onClick = {bgChange}>Click Me</button>
        </div>
        </>
    )
}

export default App;
